import React, { Component } from 'react';
import Regular from './Regular'


class App extends Component {

    frogMode = () => {
        console.log("frog mode activate");
    }

    render() {
        return (
            <div className="App">
                <button onClick={this.changeFrog}>Frog Mode</button>

            </div>
        );
    }
}

export default App;
